import { useState } from "react"
import { useNavigate } from "react-router-dom";

function Signup() {
    const [username,setusername] = useState("");
    const [pwd,setPwd] = useState("");
    const navigate = useNavigate();

    const handleSubmit = (e) => {
        e.preventDefault();
        const response = fetch('http://localhost:4000/signup',{
          method : "POST",
          headers : {
            'Accept' : 'application/json',
            'Content-Type' : 'application/json'
          },
          body : JSON.stringify({username : username,password : pwd}),
        });
        console.log(response);
        navigate("/");
    }
    return <div>
        <form onSubmit={handleSubmit}>
        {/* <input name="Username" placeholder="Username" onChange={(e)=>{setusername(e.target.value)}}></input><br/><br/> */}
        <div class="form-group">
          <label>UserName</label>
          <input class="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" placeholder="UserName" onClick={(e)=>{setusername(e.target.value)}}/>
        </div>
        {/* <input name="Password" placeholder="Password" onChange={(e)=>{setPwd(e.target.value)}}></input><br/><br/> */}
        <div class="form-group">
          <label for="exampleInputPassword1">Password</label>
          <input type="password" class="form-control" id="exampleInputPassword1" placeholder="Password" onClick={(e)=>{setPwd(e.target.value)}}/>
        </div>
        <button onClick={()=>{navigate("/")}}>SignUp?</button>
        <button>Submit</button>
       </form>
    </div>
}

export default Signup;
